import {NavLink }  from  "react-router-dom";

function Navbar(){
    const navigator = [
        { name:"Collections" ,href:"#"},
        { name:"Men" ,href:"#"},
        { name:"Women" ,href:"#"},
        { name:"About" ,href:"#"},
        { name:"Contact" ,href:"#"}
    ]
    return(
         <header>
                <div className="Logo">
                      <span>sneakers</span>
                </div>
                <nav className="menu">
                           {
                               navigator.map((navLink)=>{
                                      
                                     return (   <NavLink 
                                                    to={navLink.href}
                                                    className={({isActive})=>{
                                                     return   isActive ? "text-orange" : "text-dark"
                                                    }}                       
                                                >
                                                     {navLink.name}                       
                                               </NavLink>
                                     )
                                     
                               })
                           }
                </nav>
                <div className="cart-">
                    
                </div>

         </header>
    )

}

export default Navbar;
